import Vue from 'vue';
import App from './App.vue';
import router from './router';

import './assets/stylesheets/application.scss';

// setup fake backend
import { configureFakeBackend } from './helpers';
configureFakeBackend();

Vue.config.productionTip = false

new Vue({
  router,
  render: h => h(App),
}).$mount('#app')
